import React, {useState, useEffect} from "react";
import {connect} from "react-redux";
import * as actions from "../actions/dCandidate"
import DCandidateForm from "./DCandidateForm";
import { Grid, Paper, TableCell, TableContainer, TableRow, TableHead } from '@material-ui/core';


const DCandidates = (props) => {

    // const [x, setX] = useState(0)
    // setX(5)

    useEffect(() => {
    props.fetchAllCandidates()
    },[])

    return (
<Paper>
            <Grid container>
<Grid item xs={6}>
    <DCandidateForm/>
</Grid>
<Grid item xs={6}>
    <TableContainer>
        <Table>
            <TableHead>
<TableRow>
    <TableCell>Name</TableCell>
    <TableCell>Mobile</TableCell>
    <TableCell>Blood Group</TableCell>
</TableRow>
            </TableHead>
        </Table>
    </TableContainer>
</Grid>
 </Grid>
</Paper>
    );
}

const mapStateToProps = state =>({
  
        dCandidateList: state.dCandidate.list 
})

const mapActionToProps = {
    fetchAllCandidates: actions.fetchAll
}

export default connect(mapStateToProps, mapActionToProps)(DCandidates);
